import React, {useState} from 'react';

function ForumPosts(props) {
    const p = props.forumPosts.map();
    return(
        <div>
            <h1>{p.title}</h1>
            <p>{p.publisher}</p>
            <p>{p.content}</p>
            <p>{p.cost}</p>
        </div>
    )
}

export default ForumPosts;
